export function worksContentDataSuccess(works) {
    return {
        type: "WORKS_CONTENT_DATA_SUCCESS",
        works
    }
}

export const worksContentData = (url) => dispatch => {
    fetch(url)
        .then(
            response => {
                if (!response.ok) {
                    throw new Error(response.statusText)
                }
                return response
            })
        .then(response => response.json())
        .then(works => dispatch(worksContentDataSuccess(works)))
}
export const getMoreWorks=(e,url,start)=> dispatch =>{
    e.preventDefault;
    var formData=FormData;
    formData.append("Start",start);
    fetch(url,{
        method:'post',
        body:formData.then
    }).then(
        response => {
            if (!response.ok) {
                throw new Error(response.statusText)
            }
            return response
        })
        .then(response => response.json())
        .then(works => dispatch(worksContentDataSuccess(works)))
}
